import { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

import useAuth from '../hooks/useAuth.js';
import { loginUser } from '../services/authService.js';

function Login() {
  const navigate = useNavigate();
  const { login } = useAuth();
  const [form, setForm] = useState({ email: '', password: '' });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleChange = (event) => {
    const { name, value } = event.target;
    setForm((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    setError('');
    setLoading(true);
    try {
      const response = await loginUser(form);
      login(response.token, response.user);
      navigate('/analyze');
    } catch (err) {
      setError(err.response?.data?.message || err.message || 'Credenciales inválidas.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ display: 'flex', flexDirection: 'row', gap: '2.5rem', alignItems: 'flex-start', justifyContent: 'center', margin: '3.5rem 0' }}>
      {/* Recuadro de ejemplo profesional */}
      <article className="auth-illustration" style={{ minWidth: 320, maxWidth: 360, flex: '0 0 auto', background: 'linear-gradient(135deg, #f7f7fa 70%, #e0e7ff 100%)', borderRadius: '1.25rem', padding: '2rem 1.5rem', boxShadow: '0 4px 16px #0001', border: '1.5px solid #e0e7ff' }}>
        <p className="auth-kicker" style={{ fontWeight: 600, color: '#3b3b5c', marginBottom: '1.2rem', fontSize: '1.1rem' }}>Accede a tu cuenta</p>
        <div style={{ display: 'flex', flexDirection: 'column', gap: '1.2rem' }}>
          <div style={{ background: '#fff', borderRadius: '0.75rem', padding: '1.1rem 1.2rem', boxShadow: '0 1px 4px #0001', border: '1px solid #e0e7ff' }}>
            <span style={{ fontWeight: 500, color: '#6b7280' }}>Correo empresarial</span>
            <div style={{ fontWeight: 600, color: '#3b3b5c', fontSize: '1.05rem', marginTop: '0.2rem' }}>Ejemplo: ana.martinez@tuempresa.com</div>
          </div>
          <div style={{ background: '#fff', borderRadius: '0.75rem', padding: '1.1rem 1.2rem', boxShadow: '0 1px 4px #0001', border: '1px solid #e0e7ff' }}>
            <span style={{ fontWeight: 500, color: '#6b7280' }}>Contraseña</span>
            <div style={{ fontWeight: 600, color: '#3b3b5c', fontSize: '1.05rem', marginTop: '0.2rem' }}>TuClaveFuerte!2025</div>
          </div>
        </div>
        <p className="auth-sample-foot" style={{ marginTop: '1.5rem', color: '#6b7280', fontSize: '0.98rem' }}>
          Ingresa tus credenciales para continuar.
        </p>
      </article>
      {/* Recuadro de login real */}
      <form onSubmit={handleSubmit} style={{ display: 'flex', flexDirection: 'column', gap: '1.2rem', minWidth: 320, maxWidth: 360, flex: '0 0 auto', background: '#fff', borderRadius: '1.25rem', boxShadow: '0 4px 16px #0001', border: '1.5px solid #e0e7ff', padding: '2rem 1.5rem' }}>
        <div className="form-group">
          <label htmlFor="email" style={{ fontWeight: 500, color: '#3b3b5c' }}>Correo</label>
          <input id="email" name="email" type="email" value={form.email} onChange={handleChange} required style={{ fontWeight: 600, fontSize: '1.05rem', background: '#f7f7fa', border: '1px solid #e0e7ff', borderRadius: '0.75rem', padding: '0.8rem 1rem', marginTop: '0.2rem' }} />
        </div>
        <div className="form-group">
          <label htmlFor="password" style={{ fontWeight: 500, color: '#3b3b5c' }}>Contraseña</label>
          <input id="password" name="password" type="password" value={form.password} onChange={handleChange} required style={{ fontWeight: 600, fontSize: '1.05rem', background: '#f7f7fa', border: '1px solid #e0e7ff', borderRadius: '0.75rem', padding: '0.8rem 1rem', marginTop: '0.2rem' }} />
        </div>
        {error && <p style={{ color: 'crimson', fontWeight: 500 }}>{error}</p>}
        <button className="primary-btn" type="submit" disabled={loading} style={{ fontWeight: 600, fontSize: '1.08rem', borderRadius: '0.75rem', padding: '0.9rem 0' }}>
          {loading ? 'Ingresando...' : 'Entrar'}
        </button>
        <p style={{ textAlign: 'center', marginTop: '0.5rem', color: '#6b7280' }}>
          ¿Nuevo usuario? <Link to="/register">Crea una cuenta</Link>
        </p>
      </form>
    </div>
  );
}

export default Login;
